// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract RecordAccess {
    struct AccessRequest {
        string patientId;
        address doctor;
        uint256 timestamp;
        bool approved;
    }

    // Mapping from patient ID to their access requests
    mapping(string => AccessRequest[]) private accessRequests;

    // Mapping to track approved access
    mapping(string => mapping(address => bool)) private approvedAccess;

    // Events
    event AccessRequested(
        string patientId,
        address doctor,
        uint256 timestamp
    );

    event AccessGranted(
        string patientId,
        address doctor,
        uint256 timestamp
    );

    event AccessRevoked(
        string patientId,
        address doctor,
        uint256 timestamp
    );

    // Request access to patient records
    function requestAccess(string memory _patientId) public {
        require(!approvedAccess[_patientId][msg.sender], "Access already granted");

        AccessRequest memory newRequest = AccessRequest({
            patientId: _patientId,
            doctor: msg.sender,
            timestamp: block.timestamp,
            approved: false
        });

        accessRequests[_patientId].push(newRequest);
        emit AccessRequested(_patientId, msg.sender, block.timestamp);
    }

    // Approve access to patient records
    function approveAccess(string memory _patientId, address _doctor) public {
        require(!approvedAccess[_patientId][_doctor], "Access already granted");

        // Find the request
        bool found = false;
        for (uint i = 0; i < accessRequests[_patientId].length; i++) {
            if (accessRequests[_patientId][i].doctor == _doctor && !accessRequests[_patientId][i].approved) {
                accessRequests[_patientId][i].approved = true;
                found = true;
                break;
            }
        }

        require(found, "No pending request found");

        approvedAccess[_patientId][_doctor] = true;
        emit AccessGranted(_patientId, _doctor, block.timestamp);
    }

    // Revoke access to patient records
    function revokeAccess(string memory _patientId, address _doctor) public {
        require(approvedAccess[_patientId][_doctor], "Access not granted");

        approvedAccess[_patientId][_doctor] = false;
        emit AccessRevoked(_patientId, _doctor, block.timestamp);
    }

    // Check if a doctor has access to a patient's records
    function hasAccess(string memory _patientId, address _doctor) public view returns (bool) {
        return approvedAccess[_patientId][_doctor];
    }

    // Get all access requests for a patient
    function getAccessRequests(string memory _patientId) public view returns (AccessRequest[] memory) {
        return accessRequests[_patientId];
    }
}
